import React from 'react';

import classes from './Button.module.css';

const button = (props) => {
    if(props.type){
        if(props.type === 'submit'){
            <button 
            type='submit'
            className={[classes.Button, classes[props.btnType]].join(' ')}
            disabled={props.disabled}
            onClick={props.clicked}>
            {props.children}
            </button>
        }else{
            <button 
            type='button'
            className={[classes.Button, classes[props.btnType]].join(' ')}
            disabled={props.disabled}
            onClick={props.clicked}>
            {props.children}
            </button>
        }
    }
}

export default button;
